最直接的就是 SubscriberStateTable 了。 它的原理是利用Redis数据库中自带的keyspace消息通知机制 [4] —— 当数据库中的任何一个key对应的值发生了变化，就会触发Redis发送两个keyspace的事件通知，一个是__keyspace@<db-id>__:<key>下的<op>事件，一个是__keyspace@<db-id>__:<op>下的<key>>事件，比如，在数据库0中删除了一个key，那么就会触发两个事件通知： PUBLISH __keyspace@0__:foo del
PUBLISH __keyevent@0__:del foo 而SubscriberStateTable就是监听了第一个事件通知，然后调用相应的回调函数。和其直接相关的主要的类的类图如下，这里可以看到它继承了ConsumerTableBase，因为它是Redis的消息的Consumer： 在初始化时，我们可以看到它是如何订阅Redis的事件通知的： // File: sonic-swss-common - common/subscriberstatetable.cpp
SubscriberStateTable::SubscriberStateTable(DBConnector *db, const string &tableName, int popBatchSize, int pri) : ConsumerTableBase(db, tableName, popBatchSize, pri), m_table(db, tableName)
{ m_keyspace = "__keyspace@"; m_keyspace += to_string(db->getDbId()) + "__:" + tableName + m_table.getTableNameSeparator() + "*"; psubscribe(m_db, m_keyspace); // ... 其事件接收和分发主要由两个函数负责： readData()负责将redis中待读取的事件读取出来，并放入ConsumerTableBase中的队列中 pops()：负责将队列中的原始事件取出来，并且进行解析，然后通过函数参数传递给调用方 // File: sonic-swss-common - common/subscriberstatetable.cpp
uint64_t SubscriberStateTable::readData()
{ // ... reply = nullptr; int status; do { status = redisGetReplyFromReader(m_subscribe->getContext(), reinterpret_cast<void**>(&reply)); if(reply != nullptr && status == REDIS_OK) { m_keyspace_event_buffer.emplace_back(make_shared<RedisReply>(reply)); } } while(reply != nullptr && status == REDIS_OK); // ... return 0;
} void SubscriberStateTable::pops(deque<KeyOpFieldsValuesTuple> &vkco, const string& /*prefix*/)
{ vkco.clear(); // ... // Pop from m_keyspace_event_buffer, which is filled by readData() while (auto event = popEventBuffer()) { KeyOpFieldsValuesTuple kco; // Parsing here ... vkco.push_back(kco); } m_keyspace_event_buffer.clear();
}

