说到消息通信，我们很容易就会联想到消息队列，这就是我们的第二种通信方式 —— NotificationProducer 和 NotificationConsumer 。 这种通信方式通过Redis的自带的PubSub来实现，主要是对PUBLISH和SUBSCRIBE命令的包装，很有限的应用在最简单的通知型的场景中，比如orchagent中的timeout check, restart check之类，非传递用户配置和数据的场景： 这种通信模式下，消息的发送方Producer，主要会做两件事情：一是将消息打包成JSON格式，二是调用Redis的PUBLISH命令将消息发送出去。而且由于PUBLISH命令只能携带一个消息，所以请求中的op和data字段会被放在values的最前面，然后再调用buildJson函数将其打包成一个JSON数组的格式： int64_t swss::NotificationProducer::send(const std::string &op, const std::string &data, std::vector<FieldValueTuple> &values)
{ // Pack the op and data into values array, then pack everything into a JSON string as the message FieldValueTuple opdata(op, data); values.insert(values.begin(), opdata); std::string msg = JSon::buildJson(values); values.erase(values.begin()); // Publish message to Redis channel RedisCommand command; command.format("PUBLISH %s %s", m_channel.c_str(), msg.c_str()); // ... RedisReply reply = m_pipe->push(command); reply.checkReplyType(REDIS_REPLY_INTEGER); return reply.getReply<long long int>();
} 接收方则是利用SUBSCRIBE命令来接收所有的通知： void swss::NotificationConsumer::subscribe()
{ // ... m_subscribe = new DBConnector(m_db->getDbId(), m_db->getContext()->unix_sock.path, NOTIFICATION_SUBSCRIBE_TIMEOUT); // ... // Subscribe to Redis channel std::string s = "SUBSCRIBE " + m_channel; RedisReply r(m_subscribe, s, REDIS_REPLY_ARRAY);
}

