我们可以看到NotificationProducer/Consumer实现简单粗暴，但是由于API的限制 [8] ，它并不适合用来传递数据，所以，SONiC中提供了一种和它非常接近的另外一种基于消息队列的通信机制 —— ProducerTable 和 ConsumerTable 。 这种通信方式通过Redis的List来实现，和Notification不同的地方在于，发布给Channel中的消息非常的简单（单字符"G"），所有的数据都存储在List中，从而解决了Notification中消息大小限制的问题。在SONiC中，它主要用在FlexCounter，syncd服务和ASIC_DB中： 消息格式 ：每条消息都是一个（Key, FieldValuePairs, Op）的三元组，如果用JSON来表达这个消息，那么它的格式如下：（这里的Key是Table中数据的Key，被操作的数据是 Hash ，所以Field就是Hash中的Field，Value就是Hash中的Value了，也就是说一个消息可以对很多个Field进行操作） [ "Key", "[\"Field1\", \"Value1\", \"Field2", \"Value2\", ...]", "Op" ] Enqueue ：ProducerTable通过Lua脚本将消息三元组原子的写入消息队列中（Key = <table-name>_KEY_VALUE_OP_QUEUE，并且发布更新通知到特定的Channel（Key = <table-name>_CHANNEL）中。 Pop ：ConsumerTable也通过Lua脚本从消息队列中原子的读取消息三元组，并 在读取过程中 将其中请求的改动真正的写入到数据库中。 Note 注意 ：Redis中Lua脚本和MULTI/EXEC的原子性和通常说的数据库ACID中的原子性（Atomicity）不同，Redis中的原子性其实更接近于ACID中的隔离性（Isolation），他保证Lua脚本中所有的命令在执行的时候不会有其他的命令执行，但是并不保证Lua脚本中的所有命令都会执行成功，比如，如果Lua脚本中的第二个命令执行失败了，那么第一个命令依然会被提交，只是后面的命令就不会继续执行了。更多的细节可以参考Redis官方文档 [5] [6] 。 其主要类图如下，这里我们可以看到在ProducerTable中的m_shaEnqueue和ConsumerTable中的m_shaPop，它们就是上面我们提到的这两个Lua脚本在加载时获得的SHA了，而之后我们就可以使用Redis的EVALSHA命令对他们进行原子的调用了： ProducerTable的核心逻辑如下，我们可以看到对Values的JSON打包，和使用EVALSHA来进行Lua脚本的调用： // File: sonic-swss-common - common/producertable.cpp
ProducerTable::ProducerTable(RedisPipeline *pipeline, const string &tableName, bool buffered) // ...
{ string luaEnque = "redis.call('LPUSH', KEYS[1], ARGV[1], ARGV[2], ARGV[3]);" "redis.call('PUBLISH', KEYS[2], ARGV[4]);"; m_shaEnque = m_pipe->loadRedisScript(luaEnque);
} void ProducerTable::set(const string &key, const vector<FieldValueTuple> &values, const string &op, const string &prefix)
{ enqueueDbChange(key, JSon::buildJson(values), "S" + op, prefix);
} void ProducerTable::del(const string &key, const string &op, const string &prefix)
{ enqueueDbChange(key, "{}", "D" + op, prefix);
} void ProducerTable::enqueueDbChange(const string &key, const string &value, const string &op, const string& /* prefix */)
{ RedisCommand command; command.format( "EVALSHA %s 2 %s %s %s %s %s %s", m_shaEnque.c_str(), getKeyValueOpQueueTableName().c_str(), getChannelName(m_pipe->getDbId()).c_str(), key.c_str(), value.c_str(), op.c_str(), "G"); m_pipe->push(command, REDIS_REPLY_NIL);
} 而另一侧的ConsumerTable就稍稍复杂一点，因为其支持的op类型很多，所以逻辑都写在了一个单独的文件中（common/consumer_table_pops.lua），我们这里就不贴代码了，有兴趣的同学可以自己去看看。 // File: sonic-swss-common - common/consumertable.cpp
ConsumerTable::ConsumerTable(DBConnector *db, const string &tableName, int popBatchSize, int pri) : ConsumerTableBase(db, tableName, popBatchSize, pri) , TableName_KeyValueOpQueues(tableName) , m_modifyRedis(true)
{ std::string luaScript = loadLuaScript("consumer_table_pops.lua"); m_shaPop = loadRedisScript(db, luaScript); // ...
} void ConsumerTable::pops(deque<KeyOpFieldsValuesTuple> &vkco, const string &prefix)
{ // Note that here we are processing the messages in bulk with POP_BATCH_SIZE! RedisCommand command; command.format( "EVALSHA %s 2 %s %s %d %d", m_shaPop.c_str(), getKeyValueOpQueueTableName().c_str(), (prefix+getTableName()).c_str(), POP_BATCH_SIZE, RedisReply r(m_db, command, REDIS_REPLY_ARRAY); vkco.clear(); // Parse and pack the messages in bulk // ...
}

