关于Event Loop我们还有一个问题，那就是错误处理，比如，如果Redis的命令执行出错了，连接断开了，故障了等等的情况下，我们的服务会发生什么呢？ 从代码上来看，SONiC中的错误处理是非常简单的，就是直接抛出异常（比如，获取命令执行结果的代码，如下），然后在Event Loop中捕获异常，打印日志，接着继续执行。 RedisReply::RedisReply(RedisContext *ctx, const RedisCommand& command)
{ int rc = redisAppendFormattedCommand(ctx->getContext(), command.c_str(), command.length()); if (rc != REDIS_OK) { // The only reason of error is REDIS_ERR_OOM (Out of memory) // ref: https://github.com/redis/hiredis/blob/master/hiredis.c throw bad_alloc(); } rc = redisGetReply(ctx->getContext(), (void**)&m_reply); if (rc != REDIS_OK) { throw RedisError("Failed to redisGetReply with " + string(command.c_str()), ctx->getContext()); } guard([&]{checkReply();}, command.c_str());
} 关于异常和错误的种类及其原因，在代码里面并没有看到用于统计和Telemetry的代码，所以监控上说是比较薄弱的。另外还需要考虑数据出错的场景，比如数据库写到一半突然断开导致的脏数据，不过简单的重启相关的*syncd和*mgrd服务可能可以解决此类问题，因为启动时会进行全量同步。

