Syncd初始化的最后也是最重要的一步，就是对SAI进行初始化。 在核心组件的SAI介绍中，我们简单的展示了SAI的初始化，实现，以及它是如何为SONiC提供不同平台的支持 ，所以这里我们主要来看看Syncd是如何对SAI进行封装和调用的。 Syncd使用VendorSai来对SAI的所有API进行封装，方便上层调用。其初始化过程也非常直接，基本就是对上面两个函数的直接调用和错误处理，如下： // File: src/sonic-sairedis/syncd/VendorSai.cpp
sai_status_t VendorSai::initialize( _In_ uint64_t flags, _In_ const sai_service_method_table_t *service_method_table)
{ ... // Initialize SAI memcpy(&m_service_method_table, service_method_table, sizeof(m_service_method_table)); auto status = sai_api_initialize(flags, service_method_table); // If SAI is initialized successfully, query all SAI API methods. // sai_metadata_api_query will also update all extern global sai_*_api variables, so we can also use // sai_metadata_get_object_type_info to get methods for a specific SAI object type. if (status == SAI_STATUS_SUCCESS) { memset(&m_apis, 0, sizeof(m_apis)); int failed = sai_metadata_apis_query(sai_api_query, &m_apis); ... } ... return status;
} 当获取好所有的SAI API之后，我们就可以通过VendorSai对象来调用SAI的API了。当前调用SAI的API方式主要有两种。 第一种是通过sai_object_type_into_t来调用，它类似于为所有的SAI Object实现了一个虚表，如下： // File: src/sonic-sairedis/syncd/VendorSai.cpp
sai_status_t VendorSai::set( _In_ sai_object_type_t objectType, _In_ sai_object_id_t objectId, _In_ const sai_attribute_t *attr)
{ ... auto info = sai_metadata_get_object_type_info(objectType); sai_object_meta_key_t mk = { .objecttype = objectType, .objectkey = { .key = { .object_id = objectId } } }; return info->set(&mk, attr);
} 另外一种是通过保存在VendorSai对象中的m_apis来调用，这种方式更加直接，但是调用前需要先根据SAI Object的类型来调用不同的API。 sai_status_t VendorSai::getStatsExt( _In_ sai_object_type_t object_type, _In_ sai_object_id_t object_id, _In_ uint32_t number_of_counters, _In_ const sai_stat_id_t *counter_ids, _In_ sai_stats_mode_t mode, _Out_ uint64_t *counters)
{ sai_status_t (*ptr)( _In_ sai_object_id_t port_id, _In_ uint32_t number_of_counters, _In_ const sai_stat_id_t *counter_ids, _In_ sai_stats_mode_t mode, _Out_ uint64_t *counters); switch ((int)object_type) { case SAI_OBJECT_TYPE_PORT: ptr = m_apis.port_api->get_port_stats_ext; break; case SAI_OBJECT_TYPE_ROUTER_INTERFACE: ptr = m_apis.router_interface_api->get_router_interface_stats_ext; break; case SAI_OBJECT_TYPE_POLICER: ptr = m_apis.policer_api->get_policer_stats_ext; break; ... default: SWSS_LOG_ERROR("not implemented, FIXME"); return SAI_STATUS_FAILURE; } return ptr(object_id, number_of_counters, counter_ids, mode, counters);
} 可以明显看出，第一种调用方式代码要精炼和直观许多。

