首先，我们从源头看起。fpmsyncd在启动的时候便会开始监听FPM和Netlink的事件，用于接收路由变更消息： // File: src/sonic-swss/fpmsyncd/fpmsyncd.cpp
int main(int argc, char **argv)
{ ... DBConnector db("APPL_DB", 0); RedisPipeline pipeline(&db); RouteSync sync(&pipeline); // Register netlink message handler NetLink netlink; netlink.registerGroup(RTNLGRP_LINK); NetDispatcher::getInstance().registerMessageHandler(RTM_NEWROUTE, &sync); NetDispatcher::getInstance().registerMessageHandler(RTM_DELROUTE, &sync); NetDispatcher::getInstance().registerMessageHandler(RTM_NEWLINK, &sync); NetDispatcher::getInstance().registerMessageHandler(RTM_DELLINK, &sync); rtnl_route_read_protocol_names(DefaultRtProtoPath); ... while (true) { try { // Launching FPM server and wait for zebra to connect. FpmLink fpm(&sync); ... fpm.accept(); ... } catch (FpmLink::FpmConnectionClosedException &e) { // If connection is closed, keep retrying until it succeeds, before handling any other events. cout << "Connection lost, reconnecting..." << endl; } ... }
} 这样，所有的路由变更消息都会以Netlink的形式发送给RouteSync，其中 EVPN Type 5 必须以原始消息的形式进行处理，所以会发送给onMsgRaw，其他的消息都会统一的发给处理Netlink的onMsg回调：（关于Netlink如何接收和处理消息，请移步 4.1.2 Netlink ） // File: src/sonic-swss/fpmsyncd/fpmlink.cpp
// Called from: FpmLink::readData()
void FpmLink::processFpmMessage(fpm_msg_hdr_t* hdr)
{ size_t msg_len = fpm_msg_len(hdr); nlmsghdr *nl_hdr = (nlmsghdr *)fpm_msg_data(hdr); ... /* Read all netlink messages inside FPM message */ for (; NLMSG_OK (nl_hdr, msg_len); nl_hdr = NLMSG_NEXT(nl_hdr, msg_len)) { /* * EVPN Type5 Add Routes need to be process in Raw mode as they contain * RMAC, VLAN and L3VNI information. * Where as all other route will be using rtnl api to extract information * from the netlink msg. */ bool isRaw = isRawProcessing(nl_hdr); nl_msg *msg = nlmsg_convert(nl_hdr); ... nlmsg_set_proto(msg, NETLINK_ROUTE); if (isRaw) { /* EVPN Type5 Add route processing */ /* This will call into onRawMsg() */ processRawMsg(nl_hdr); } else { /* This will call into onMsg() */ NetDispatcher::getInstance().onNetlinkMessage(msg); } nlmsg_free(msg); }
} void FpmLink::processRawMsg(struct nlmsghdr *h)
{ m_routesync->onMsgRaw(h);
}; 接着，RouteSync收到路由变更的消息之后，会在onMsg和onMsgRaw中进行判断和分发： // File: src/sonic-swss/fpmsyncd/routesync.cpp
void RouteSync::onMsgRaw(struct nlmsghdr *h)
{ if ((h->nlmsg_type != RTM_NEWROUTE) && (h->nlmsg_type != RTM_DELROUTE)) return; ... onEvpnRouteMsg(h, len);
} void RouteSync::onMsg(int nlmsg_type, struct nl_object *obj)
{ // Refill Netlink cache here ... struct rtnl_route *route_obj = (struct rtnl_route *)obj; auto family = rtnl_route_get_family(route_obj); if (family == AF_MPLS) { onLabelRouteMsg(nlmsg_type, obj); return; } ... unsigned int master_index = rtnl_route_get_table(route_obj); char master_name[IFNAMSIZ] = {0}; if (master_index) { /* If the master device name starts with VNET_PREFIX, it is a VNET route. The VNET name is exactly the name of the associated master device. */ getIfName(master_index, master_name, IFNAMSIZ); if (string(master_name).find(VNET_PREFIX) == 0) { onVnetRouteMsg(nlmsg_type, obj, string(master_name)); } /* Otherwise, it is a regular route (include VRF route). */ else { onRouteMsg(nlmsg_type, obj, master_name); } } else { onRouteMsg(nlmsg_type, obj, NULL); }
} 从上面的代码中，我们可以看到这里会有四种不同的路由处理入口，这些不同的路由会被最终通过各自的 ProducerStateTable 写入到APPL_DB中的不同的Table中： 路由类型 处理函数 Table MPLS onLabelRouteMsg LABLE_ROUTE_TABLE Vnet VxLan Tunnel Route onVnetRouteMsg VNET_ROUTE_TUNNEL_TABLE 其他Vnet路由 onVnetRouteMsg VNET_ROUTE_TABLE EVPN Type 5 onEvpnRouteMsg ROUTE_TABLE 普通路由 onRouteMsg ROUTE_TABLE 这里以普通路由来举例子，其他的函数的实现虽然有所不同，但是主体的思路是一样的： // File: src/sonic-swss/fpmsyncd/routesync.cpp
void RouteSync::onRouteMsg(int nlmsg_type, struct nl_object *obj, char *vrf)
{ // Parse route info from nl_object here. ... // Get nexthop lists string gw_list; string intf_list; string mpls_list; getNextHopList(route_obj, gw_list, mpls_list, intf_list); ... // Build route info here, including protocol, interface, next hops, MPLS, weights etc. vector<FieldValueTuple> fvVector; FieldValueTuple proto("protocol", proto_str); FieldValueTuple gw("nexthop", gw_list); ... fvVector.push_back(proto); fvVector.push_back(gw); ... // Push to ROUTE_TABLE via ProducerStateTable. m_routeTable.set(destipprefix, fvVector); SWSS_LOG_DEBUG("RouteTable set msg: %s %s %s %s", destipprefix, gw_list.c_str(), intf_list.c_str(), mpls_list.c_str()); ...
}

