接下来，这些路由信息会来到orchagent。在orchagent启动的时候，它会创建好VNetRouteOrch和RouteOrch对象，这两个对象分别用来监听和处理Vnet相关路由和EVPN/普通路由： // File: src/sonic-swss/orchagent/orchdaemon.cpp
bool OrchDaemon::init()
{ ... vector<string> vnet_tables = { APP_VNET_RT_TABLE_NAME, APP_VNET_RT_TUNNEL_TABLE_NAME }; VNetRouteOrch *vnet_rt_orch = new VNetRouteOrch(m_applDb, vnet_tables, vnet_orch); ... const int routeorch_pri = 5; vector<table_name_with_pri_t> route_tables = { { APP_ROUTE_TABLE_NAME, routeorch_pri }, { APP_LABEL_ROUTE_TABLE_NAME, routeorch_pri } }; gRouteOrch = new RouteOrch(m_applDb, route_tables, gSwitchOrch, gNeighOrch, gIntfsOrch, vrf_orch, gFgNhgOrch, gSrv6Orch); ...
} 所有Orch对象的消息处理入口都是doTask，这里RouteOrch和VNetRouteOrch也不例外，这里我们以RouteOrch为例子，看看它是如何处理路由变化的。 Note 从RouteOrch上，我们可以真切的感受到为什么这些类被命名为Orch。RouteOrch有2500多行，其中会有和很多其他Orch的交互，以及各种各样的细节…… 代码是相对难读，请大家读的时候一定保持耐心。 RouteOrch在处理路由消息的时候有几点需要注意： 从上面init函数，我们可以看到RouteOrch不仅会管理普通路由，还会管理MPLS路由，这两种路由的处理逻辑是不一样的，所以在下面的代码中，为了简化，我们只展示普通路由的处理逻辑。 因为ProducerStateTable在传递和接受消息的时候都是批量传输的，所以，RouteOrch在处理消息的时候，也是批量处理的。为了支持批量处理，RouteOrch会借用EntityBulker<sai_route_api_t> gRouteBulker将需要改动的SAI路由对象缓存起来，然后在doTask()函数的最后，一次性将这些路由对象的改动应用到SAI中。 路由的操作会需要很多其他的信息，比如每个Port的状态，每个Neighbor的状态，每个VRF的状态等等。为了获取这些信息，RouteOrch会与其他的Orch对象进行交互，比如PortOrch，NeighOrch，VRFOrch等等。 // File: src/sonic-swss/orchagent/routeorch.cpp
void RouteOrch::doTask(Consumer& consumer)
{ // Calling PortOrch to make sure all ports are ready before processing route messages. if (!gPortsOrch->allPortsReady()) { return; } // Call doLabelTask() instead, if the incoming messages are from MPLS messages. Otherwise, move on as regular routes. ... /* Default handling is for ROUTE_TABLE (regular routes) */ auto it = consumer.m_toSync.begin(); while (it != consumer.m_toSync.end()) { // Add or remove routes with a route bulker while (it != consumer.m_toSync.end()) { KeyOpFieldsValuesTuple t = it->second; // Parse route operation from the incoming message here. string key = kfvKey(t); string op = kfvOp(t); ... // resync application: // - When routeorch receives 'resync' message (key = "resync", op = "SET"), it marks all current routes as dirty // and waits for 'resync complete' message. For all newly received routes, if they match current dirty routes, // it unmarks them dirty. // - After receiving 'resync complete' (key = "resync", op != "SET") message, it creates all newly added routes // and removes all dirty routes. ... // Parsing VRF and IP prefix from the incoming message here. ... // Process regular route operations. if (op == SET_COMMAND) { // Parse and validate route attributes from the incoming message here. string ips; string aliases; ... // If the nexthop_group is empty, create the next hop group key based on the IPs and aliases. // Otherwise, get the key from the NhgOrch. The result will be stored in the "nhg" variable below. NextHopGroupKey& nhg = ctx.nhg; ... if (nhg_index.empty()) { // Here the nexthop_group is empty, so we create the next hop group key based on the IPs and aliases. ... string nhg_str = ""; if (blackhole) { nhg = NextHopGroupKey(); } else if (srv6_nh == true) { ... nhg = NextHopGroupKey(nhg_str, overlay_nh, srv6_nh); } else if (overlay_nh == false) { ... nhg = NextHopGroupKey(nhg_str, weights); } else { ... nhg = NextHopGroupKey(nhg_str, overlay_nh, srv6_nh); } } else { // Here we have a nexthop_group, so we get the key from the NhgOrch. const NhgBase& nh_group = getNhg(nhg_index); nhg = nh_group.getNhgKey(); ... } ... // Now we start to create the SAI route entry. if (nhg.getSize() == 1 && nhg.hasIntfNextHop()) { // Skip certain routes, such as not valid, directly routes to tun0, linklocal or multicast routes, etc. ... // Create SAI route entry in addRoute function. if (addRoute(ctx, nhg)) it = consumer.m_toSync.erase(it); else it++; } /* * Check if the route does not exist or needs to be updated or * if the route is using a temporary next hop group owned by * NhgOrch. */ else if (m_syncdRoutes.find(vrf_id) == m_syncdRoutes.end() || m_syncdRoutes.at(vrf_id).find(ip_prefix) == m_syncdRoutes.at(vrf_id).end() || m_syncdRoutes.at(vrf_id).at(ip_prefix) != RouteNhg(nhg, ctx.nhg_index) || gRouteBulker.bulk_entry_pending_removal(route_entry) || ctx.using_temp_nhg) { if (addRoute(ctx, nhg)) it = consumer.m_toSync.erase(it); else it++; } ... } // Handle other ops, like DEL_COMMAND for route deletion, etc. ... } // Flush the route bulker, so routes will be written to syncd and ASIC gRouteBulker.flush(); // Go through the bulker results. // Handle SAI failures, update neighbors, counters, send notifications in add/removeRoutePost functions. ... /* Remove next hop group if the reference count decreases to zero */ ... }
} 解析完路由操作后，RouteOrch会调用addRoute或者removeRoute函数来创建或者删除路由。这里以添加路由addRoute为例子来继续分析。它的逻辑主要分为几个大部分： 从NeighOrch中获取下一跳信息，并检查下一跳是否真的可用。 如果是新路由，或者是重新添加正在等待删除的路由，那么就会创建一个新的SAI路由对象 如果是已有的路由，那么就更新已有的SAI路由对象 // File: src/sonic-swss/orchagent/routeorch.cpp
bool RouteOrch::addRoute(RouteBulkContext& ctx, const NextHopGroupKey &nextHops)
{ // Get nexthop information from NeighOrch. // We also need to check PortOrch for inband port, IntfsOrch to ensure the related interface is created and etc. ... // Start to sync the SAI route entry. sai_route_entry_t route_entry; route_entry.vr_id = vrf_id; route_entry.switch_id = gSwitchId; copy(route_entry.destination, ipPrefix); sai_attribute_t route_attr; auto& object_statuses = ctx.object_statuses; // Create a new route entry in this case. // // In case the entry is already pending removal in the bulk, it would be removed from m_syncdRoutes during the bulk call. // Therefore, such entries need to be re-created rather than set attribute. if (it_route == m_syncdRoutes.at(vrf_id).end() || gRouteBulker.bulk_entry_pending_removal(route_entry)) { if (blackhole) { route_attr.id = SAI_ROUTE_ENTRY_ATTR_PACKET_ACTION; route_attr.value.s32 = SAI_PACKET_ACTION_DROP; } else { route_attr.id = SAI_ROUTE_ENTRY_ATTR_NEXT_HOP_ID; route_attr.value.oid = next_hop_id; } /* Default SAI_ROUTE_ATTR_PACKET_ACTION is SAI_PACKET_ACTION_FORWARD */ object_statuses.emplace_back(); sai_status_t status = gRouteBulker.create_entry(&object_statuses.back(), &route_entry, 1, &route_attr); if (status == SAI_STATUS_ITEM_ALREADY_EXISTS) { return false; } } // Update existing route entry in this case. else { // Set the packet action to forward when there was no next hop (dropped) and not pointing to blackhole. if (it_route->second.nhg_key.getSize() == 0 && !blackhole) { route_attr.id = SAI_ROUTE_ENTRY_ATTR_PACKET_ACTION; route_attr.value.s32 = SAI_PACKET_ACTION_FORWARD; object_statuses.emplace_back(); gRouteBulker.set_entry_attribute(&object_statuses.back(), &route_entry, &route_attr); } // Only 1 case is listed here as an example. Other cases are handled with similar logic by calling set_entry_attributes as well. ... } ...
} 在创建和设置好所有的路由后，RouteOrch会调用gRouteBulker.flush()来将所有的路由写入到ASIC_DB中。flush()函数很简单，就是将所有的请求分批次进行处理，默认情况下每一批是1000个，这个定义在OrchDaemon中，并通过构造函数传入： // File: src/sonic-swss/orchagent/orchdaemon.cpp
#define DEFAULT_MAX_BULK_SIZE 1000
size_t gMaxBulkSize = DEFAULT_MAX_BULK_SIZE; // File: src/sonic-swss/orchagent/bulker.h
template <typename T>
class EntityBulker
{
public: using Ts = SaiBulkerTraits<T>; using Te = typename Ts::entry_t; ... void flush() { // Bulk remove entries if (!removing_entries.empty()) { // Split into batches of max_bulk_size, then call flush. Similar to creating_entries, so details are omitted. std::vector<Te> rs; ... flush_removing_entries(rs); removing_entries.clear(); } // Bulk create entries if (!creating_entries.empty()) { // Split into batches of max_bulk_size, then call flush_creating_entries to call SAI batch create API to create // the objects in batch. std::vector<Te> rs; std::vector<sai_attribute_t const*> tss; std::vector<uint32_t> cs; for (auto const& i: creating_entries) { sai_object_id_t *pid = std::get<0>(i); auto const& attrs = std::get<1>(i); if (*pid == SAI_NULL_OBJECT_ID) { rs.push_back(pid); tss.push_back(attrs.data()); cs.push_back((uint32_t)attrs.size()); // Batch create here. if (rs.size() >= max_bulk_size) { flush_creating_entries(rs, tss, cs); } } } flush_creating_entries(rs, tss, cs); creating_entries.clear(); } // Bulk update existing entries if (!setting_entries.empty()) { // Split into batches of max_bulk_size, then call flush. Similar to creating_entries, so details are omitted. std::vector<Te> rs; std::vector<sai_attribute_t> ts; std::vector<sai_status_t*> status_vector; ... flush_setting_entries(rs, ts, status_vector); setting_entries.clear(); } } sai_status_t flush_creating_entries( _Inout_ std::vector<Te> &rs, _Inout_ std::vector<sai_attribute_t const*> &tss, _Inout_ std::vector<uint32_t> &cs) { ... // Call SAI bulk create API size_t count = rs.size(); std::vector<sai_status_t> statuses(count); sai_status_t status = (*create_entries)((uint32_t)count, rs.data(), cs.data(), tss.data() , SAI_BULK_OP_ERROR_MODE_IGNORE_ERROR, statuses.data()); // Set results back to input entries and clean up the batch below. for (size_t ir = 0; ir < count; ir++) { auto& entry = rs[ir]; sai_status_t *object_status = creating_entries[entry].second; if (object_status) { *object_status = statuses[ir]; } } rs.clear(); tss.clear(); cs.clear(); return status; } // flush_removing_entries and flush_setting_entries are similar to flush_creating_entries, so we omit them here. ...
};

